import React, { useState } from "react";
import "./UserDashboard.css";

function UsuarioDashboard() {
  const [showModal, setShowModal] = useState(null); // Controla qué modal mostrar
  const [formData, setFormData] = useState({
    nuevoNombreUsuario: "",
    nombreUsuario: "",
    dni: "",
    nuevaContrasena: "",
    codigoEdificio: "",
    piso: "",
    numeroUnidad: "",
    ubicacion: "",
    descripcion: "",
    tipoReclamo: "",
    idReclamo: "",
    idImagen: "",
    archivo: null,
  });

  const cerrarSesion = () => {
    localStorage.removeItem("jwtToken");
    alert("Sesión cerrada. Redirigiendo a la página de inicio.");
    window.location.href = "http://localhost:3000/";
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleFileChange = (e) => {
    setFormData({ ...formData, archivo: e.target.files[0] });
  };

  const fetchData = async (url, method, body) => {
    try {
      const headers = {
        "Content-Type": "application/json",
        Authorization: `Bearer ${localStorage.getItem("jwtToken")}`,
      };

      const options = {
        method,
        headers,
      };

      if (body) options.body = JSON.stringify(body);

      const response = await fetch(url, options);
      if (response.ok) {
        return await response.json();
      } else {
        const errorData = await response.json();
        throw new Error(errorData.message || "Error desconocido");
      }
    } catch (error) {
      console.error("Error:", error.message);
      alert(`Error: ${error.message}`);
      throw error;
    }
  };

  const agregarReclamoConUnidad = async () => {
    const body = {
      codigoEdificio: formData.codigoEdificio,
      piso: formData.piso,
      numeroUnidad: formData.numeroUnidad,
      ubicacion: formData.ubicacion,
      descripcion: formData.descripcion,
      tipoReclamo: formData.tipoReclamo,
    };
    await fetchData("http://localhost:8080/api/reclamos/conUnidad", "POST", body);
    alert("Reclamo agregado con éxito.");
    setShowModal(null);
  };

  const agregarReclamoSinUnidad = async () => {
    const body = {
      codigoEdificio: formData.codigoEdificio,
      ubicacion: formData.ubicacion,
      descripcion: formData.descripcion,
      tipoReclamo: formData.tipoReclamo,
    };
    await fetchData("http://localhost:8080/api/reclamos/sinUnidad", "POST", body);
    alert("Reclamo agregado con éxito.");
    setShowModal(null);
  };

  const actualizarReclamo = async () => {
    const body = {
      idReclamo: formData.idReclamo,
      ubicacion: formData.ubicacion,
      descripcion: formData.descripcion,
    };
    await fetchData("http://localhost:8080/api/reclamos/actualizar", "PUT", body);
    alert("Reclamo actualizado con éxito.");
    setShowModal(null);
  };

  const agregarImagenAlReclamo = async () => {
    const formDataObj = new FormData();
    formDataObj.append("archivo", formData.archivo);
    formDataObj.append("idReclamo", formData.idReclamo);

    try {
      const response = await fetch("http://localhost:8080/api/imagenes/agregar", {
        method: "POST",
        headers: {
          Authorization: `Bearer ${localStorage.getItem("jwtToken")}`,
        },
        body: formDataObj,
      });

      if (response.ok) {
        alert("Imagen agregada con éxito.");
        setShowModal(null);
      } else {
        const errorData = await response.json();
        throw new Error(errorData.message || "Error desconocido");
      }
    } catch (error) {
      console.error("Error:", error.message);
      alert(`Error: ${error.message}`);
    }
  };

  const actualizarImagenDelReclamo = async () => {
    const formDataObj = new FormData();
    formDataObj.append("archivo", formData.archivo);

    try {
      const response = await fetch(
        `http://localhost:8080/api/imagenes/actualizar/${formData.idImagen}`,
        {
          method: "PUT",
          headers: {
            Authorization: `Bearer ${localStorage.getItem("jwtToken")}`,
          },
          body: formDataObj,
        }
      );

      if (response.ok) {
        alert("Imagen actualizada con éxito.");
        setShowModal(null);
      } else {
        const errorData = await response.json();
        throw new Error(errorData.message || "Error desconocido");
      }
    } catch (error) {
      console.error("Error:", error.message);
      alert(`Error: ${error.message}`);
    }
  };

  const eliminarImagenDelReclamo = async () => {
    await fetchData(
      `http://localhost:8080/api/imagenes/${formData.idImagen}`,
      "DELETE"
    );
    alert("Imagen eliminada con éxito.");
    setShowModal(null);
  };

  const verImagenPorReclamo = async () => {
    const data = await fetchData(
      `http://localhost:8080/api/imagenes/ver/reclamo/${formData.idReclamo}`,
      "GET"
    );
    console.log(data);
    alert("Consulta realizada. Revisa la consola para ver los datos.");
    setShowModal(null);
  };

  const verMisReclamos = async () => {
    const data = await fetchData(
      "http://localhost:8080/api/reclamos/mis-reclamos",
      "GET"
    );
    console.log(data);
    alert("Consulta realizada. Revisa la consola para ver los datos.");
    setShowModal(null);
  };

  const verReclamoPorId = async () => {
    const data = await fetchData(
      `http://localhost:8080/api/reclamos/${formData.idReclamo}`,
      "GET"
    );
    console.log(data);
    alert("Consulta realizada. Revisa la consola para ver los datos.");
    setShowModal(null);
  };

  return (
    <div className="user-dashboard">
      <header className="dashboard-header">
        <h1 className="dashboard-title">PROPSUITE</h1>
        <nav className="header-buttons">
          <div className="dropdown">
            <button className="nav-button">Usuario</button>
            <ul className="dropdown-menu">
              <li>
                <button onClick={cerrarSesion}>Cerrar sesión</button>
              </li>
            </ul>
          </div>
        </nav>
      </header>

      <div className="section-container">
        <h2 className="section-title">Reclamos</h2>
        {[
          { action: "agregarReclamoConUnidad", text: "Agregar Reclamo a Unidad" },
          { action: "agregarReclamoSinUnidad", text: "Agregar Reclamo a Área Común" },
          { action: "actualizarReclamo", text: "Actualizar Reclamo" },
        ].map(({ action, text }) => (
          <button
            key={action}
            className="section-button"
            onClick={() => setShowModal(action)}
          >
            {text}
          </button>
        ))}
      </div>
      {/* Modales dinámicos */}
      {showModal && (
        <Modal
          action={showModal}
          formData={formData}
          onInputChange={handleInputChange}
          onFileChange={handleFileChange}
          onClose={() => setShowModal(null)}
        />
      )}
    </div>
  );
}

export default UsuarioDashboard;
